import React from "react";

function ContactMe() {
  function contactBox(site, img, link) {
    return (
      <a href={link}>
        <div className="contactBox">
          <img src={img} alt={site}></img>
        </div>
      </a>
    );
  }
  return (
    <div>
      <h1>Contact Me</h1>
    </div>
  );
}

export default ContactMe;
